(11, 'Mantenimiento de los servidores 11-Feb-2014', 'Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.', 'all', 'block', 1392138660, 1392138900, 1392138618),
(12, 'Mensaje informativo mantenimiento', 'Cordial saludo.\r\nSigma mÃ³vil informa que a partir del 14 de Febrero de 2014 hasta el 16 de Febrero de 2014 se suspenderÃ¡ el servicio por motivos de mantenimiento de nuestra plataforma.\r\nRecuerde querido usuario en Sigma MÃ³vil trabajamos para usted.', 'all', 'info', 1392146520, 1392613140, 1392146345),
(13, 'Advertencia su servicio esta a punto de ser suspendido', 'Querido usuario, le informamos que en el momento hay 3 facturas vencidas y proximamente iniciaremos la suspensiÃ³n del servicio y tomaremos las respectivas medidas legales.\r\n\r\nSi desea resolver su situacion acerquese a alguna de nuestras oficinas y con gusto le atenderemos.\r\n\r\nCordial saludo.', '["13"]', 'block', 1392147480, 1393615860, 1392147395);
